import React from 'react'

export default function ChatRoomButton(props) {
    console.log(props.room)
    return (
        <div>
            <li className="chat-room" key={props.room.id}>
                <button value={props.room.id} onClick={props.onClick} >{props.room.id}</button>
            </li>
        </div>
    )
}
